import Axios from 'axios';
import { useEffect, useState } from 'react';

function Homepage()
{
    useState([])
    useEffect(()=>{
        Axios.get("https://dummyjson.com/products")
        .then((obj)=>console.log(obj.data.products))
        .catch((err)=>console.log(err))
    },[])
    return(
        <div>
            <h1>Hi....</h1>
        </div>
    );
}

export default Homepage;
